const App = () => {
  let [count, setCount] = useState(0);
  return (
    <div className="App">
      <button onClick={() => setCount((prevCount) => prevCount - 1)}><h2>-</h2></button>
      <h1>{ count }</h1>
      <button onClick={() => setCount((prevCount) => prevCount + 1)}><h2>+</h2></button>
    </div>
  );
}

export default App;
